import { IgrStackedLineSeries } from "./igr-stacked-line-series";
import { Stacked100LineSeries } from "./Stacked100LineSeries";
/**
 * Represents a IgxDataChartComponent stacked100 line series.
*/
export class IgrStacked100LineSeries extends IgrStackedLineSeries {
    createImplementation() {
        return new Stacked100LineSeries();
    }
    /**
                                 * @hidden
                                 */
    get i() {
        return this._implementation;
    }
    constructor(props) {
        super(props);
    }
    get isPercentBased() {
        return this.i.aa4;
    }
}
